content:
MẶT TIỀN NGUYỄN THÁI HỌC, PHƯỜNG CẦU ÔNG LÃNH, QUẬN 1 - 13 PHÒNG 35M2 + THANG MÁY GIÁ 120 TRIỆU

* Chính chủ cho thuê nhà mặt tiền đường Nguyễn Thái Học, Phường Cầu Ông Lãnh, Quận 1.

- Diện tích: 5 x 20m vuông vức nở hậu;
- Kết cấu: 1 trệt + 1 lửng + 5 lầu + sân thượng;
- Tầng trệt trống suốt (có thể cho thuê lại làm Coffee - Văn phòng đại diện - Shop Quần Áo... Giá từ 20 - 30 triệu/tháng).
- Tầng lửng đang có hợp đồng thuê 20 triệu/tháng - Đã nhận tiền thuê trước 1 năm - Sẽ gửi lại cho người thuê sau;
- 5 tầng trên mỗi lầu 2 phòng 35 - 45 m2 (dạng 1 - bedrooms);
- Nhà mới hoàn toàn + thang máy mới lắp;
- Đối diện là 2 bãi giữ xe 24/24;
- Giá khai thác từng phòng trọng khu vực là 10.44 triệu - 12.75 triệu/phòng;
- Hợp đồng 6 năm - Cọc 3 tháng - Thanh toán tiền từng tháng - 2 năm tăng 10%;
- Giá cho thuê nguyên căn 120 triệu/tháng;
LIÊN HỆ: Đình Nguyên 0912619456
